  function passFactorySigner(address _memeFactory)
            public returns (bool) {
    require(
      msg.sender == factorySigner,
      'Error: msg.sender must be factorySigner');

    factorySigner = _memeFactory;
    emit FactorySignerChanged(msg.sender, factorySigner);
    return true;
  }
